script: |
  super -f text -I q20.spq | sort > q20.out

inputs:
  - name: q20.spq
    data: |
      SELECT - + col2 * - - ( - col2 ) col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NOT + + ( + col1 ) NOT BETWEEN + + col0 + + CAST ( NULL AS REAL ) + + col1 * ( + col0 ) AND NULL );
  - name: tab0

outputs:
  - name: q20.out
    data: |
